import React from "react";
import './styles/logIn.css';
import {Card} from "react-bootstrap";
import Input from "../components/Input";

const LogIn = () => {
    return(
        <div className="LogIn">
            <div className='Form'>
                <Card className='Form-card'>
                    <Card.Title className='Card-title Caption'>
                        <b>Увійти</b>
                    </Card.Title>
                    <Card.Body>
                        <Input label='Email' placeholder='Введіть пошту'/>
                    </Card.Body>
                </Card>
            </div>
        </div>
    );
}
export default LogIn;
